import React from 'react';
import { Typography, Container, Grid, Card, CardContent, Accordion, AccordionSummary, AccordionDetails } from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import Footer from './footer';

// Slider Component
const ImageSlider = () => {
  // Dummy images
  const images = [
    'https://via.placeholder.com/400x200',
    'https://via.placeholder.com/400x200',
    'https://via.placeholder.com/400x200',
  ];

  return (
    <Container maxWidth="md" sx={{ marginTop: '2rem' }}>
      <Typography variant="h4" align="center" gutterBottom>
        Image Slider
      </Typography>
      <Grid container spacing={2} justifyContent="center">
        {images.map((image, index) => (
          <Grid item key={index}>
            <img src={image} alt={`Slide ${index + 1}`} style={{ width: '100%', height: 'auto' }} />
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

// Achievement Cards Component
const AchievementCards = () => {
  // Dummy achievement data
  const achievements = [
    { title: 'Achievement 1', description: 'Description of achievement 1' },
    { title: 'Achievement 2', description: 'Description of achievement 2' },
    { title: 'Achievement 3', description: 'Description of achievement 3' },
  ];

  return (
    <Container maxWidth="md" sx={{ marginTop: '2rem' }}>
      <Typography variant="h4" align="center" gutterBottom>
        Achievement Cards
      </Typography>
      <Grid container spacing={3} justifyContent="center">
        {achievements.map((achievement, index) => (
          <Grid item key={index} xs={12} sm={6} md={4}>
            <Card>
              <CardContent>
                <Typography variant="h6" gutterBottom>
                  {achievement.title}
                </Typography>
                <Typography>{achievement.description}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

// FAQ Accordion Component
const FAQAccordion = () => {
  // Dummy FAQ data
  const faqs = [
    { question: 'Question 1', answer: 'Answer to question 1' },
    { question: 'Question 2', answer: 'Answer to question 2' },
    { question: 'Question 3', answer: 'Answer to question 3' },
  ];

  return (
    <Container maxWidth="md" sx={{ marginTop: '2rem' }}>
      <Typography variant="h4" align="center" gutterBottom>
        FAQ
      </Typography>
      <Grid container spacing={2} justifyContent="center">
        {faqs.map((faq, index) => (
          <Grid item key={index} xs={12} sm={6} md={4}>
            <Accordion>
              <AccordionSummary expandIcon={<ExpandMoreIcon />}>
                <Typography>{faq.question}</Typography>
              </AccordionSummary>
              <AccordionDetails>
                <Typography>{faq.answer}</Typography>
              </AccordionDetails>
            </Accordion>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

// Teachers and Staff Column Component
const TeachersStaffColumn = () => {
  // Dummy teachers and staff data
  const teachersStaff = [
    'Teacher 1',
    'Teacher 2',
    'Teacher 3',
    'Staff 1',
    'Staff 2',
    'Staff 3',
  ];

  return (
    <Container maxWidth="md" sx={{ marginTop: '2rem' }}>
      <Typography variant="h4" align="center" gutterBottom>
        Teachers and Staff
      </Typography>
      <Grid container spacing={2} justifyContent="center">
        {teachersStaff.map((person, index) => (
          <Grid item key={index} xs={12} sm={6} md={4}>
            <Typography>{person}</Typography>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

// Home Page Component
const Home = () => {
  return (
    <>
      <ImageSlider />
      <AchievementCards />
      <FAQAccordion />
      <TeachersStaffColumn />
      <Footer/>
    </>
  );
};

export default Home;
